import Card from './Card'
import { CardGroup } from "reactstrap"

const Cards=(props)=>{
    const Cards=props.map((card, index)=>{
        return(
            <Card {...card} key={index} />
        )
    })
    return(
        <CardGroup>
            {Cards}
        </CardGroup>
    )
}
export default Cards;
